import React from 'react';
import {BrowserRouter, Route} from 'react-router-dom';

import logo from './phoenix-logo.png';

import inst from './images/contacts/instagram.png';
import vkon from './images/contacts/vkontakte.png';
import visa from './images/pay/visa.png';
import verVisa from './images/pay/verVisa.png';
import masterCard from './images/pay/masterCard.png';
import masterCardSecur from './images/pay/masterCardSecur.png';
import maestro from './images/pay/maestro.png';
import belcard from './images/pay/belcard.png';
import bePaid from './images/pay/bePaid.png';
import cartaPokupok from './images/pay/cartaPokupok.png';
import halva from './images/pay/halva.png';
import fun from './images/pay/fun.jpg';
import magnit from './images/pay/magnit.png';

import Catalog from './Catalog';
import Cart from './Cart';

import './media.css';
import './App.css';
import './Cart.css';

const App = function () {
	const openBurger = function () {
		const nav = document.querySelector('.nav-goods');
		nav.classList.add('burger-open');
		console.log(nav);
	};

	const exitBurger = function () {
		const nav = document.querySelector('.nav-goods');
		nav.classList.remove('burger-open');
	};

	return (
		<BrowserRouter>
		<div className="site">
			<header className="header">
				<div className="header-container">
					<div className="header-wrapper">

						<div className="header-top-left">Доставка пиццы<div>бесплатно</div></div>

						<div className="header-top-center"><a href="#"><img className='logo' src={logo}></img></a>Пицца Феникс</div>

						<div className="header-top-right">
							<div className="header-contacts">377-60-20</div>
							<div className="header-deliverytime">доставка пиццы<div>круглосуточно</div></div>
						</div>

					</div>
				</div>
			</header>

			<nav className="nav">
				<div className="nav-container">
					<div className="nav-wrapper">

						<ul className="nav-goods"> {/* burger open класс */}
							<li className="pizza-ico"><a href="#">Пиццы</a></li>
							<li className="snack-ico"><a href="#">Закуски</a></li>
							<li className="dessert-ico"><a href="#">Десерты</a></li>
							<li className="drink-ico"><a href="#">Напитки</a></li>
							<li className="sauce-ico"><a href="#">Соусы</a></li>
							<div className="bg" onClick={exitBurger}></div>
						</ul>

						<div className="cart-btn"><a href="#">Корзина</a></div>

						<div className="burger-btn" onClick={openBurger}>
							<div className="burger-line"></div>
						</div>

					</div>
				</div>
			</nav>

			{/* <div className='slider'></div> */}

			<main className="main">
				<Route exact path='/catalog' component={Catalog} />
				<Route  path='/cart' component={Cart} />
			</main>
			<footer className="footer">
				<div className="footer-container">
					<div className="footer-wrapper">
						<div className="logo"><a href="#"><img src={logo}></img></a></div>
						<div className="footer-contacts">
							<div className="messangers">
								<a href="#"><img src={inst}></img></a>
								<a href="#"><img src={vkon}></img></a>
							</div>
							<div className="pay">
								<a href="#"><img src={visa}></img></a>
								<a href="#"><img src={verVisa}></img></a>
								<a href="#"><img src={masterCard}></img></a>
								<a href="#"><img src={masterCardSecur}></img></a>
								<a href="#"><img src={maestro}></img></a>
								<a href="#"><img src={belcard}></img></a>
								<a href="#"><img src={bePaid}></img></a>
								<a href="#"><img src={cartaPokupok}></img></a>
								<a href="#"><img src={halva}></img></a>
								<a href="#"><img src={fun}></img></a>
								<a href="#"><img src={magnit}></img></a>
							</div>
							<div className="tel">+375 29 377-60-20</div>
						</div>
					</div>
				</div>
			</footer>
		</div>
		</BrowserRouter>
	)
}

export default App;
